import React, {useEffect,useState} from "react";

const Background = (props) => {

  const [backimage,setData] = useState([])

  function backgroundImage(props) {
    fetch(`https://picsum.photos/v2/list?page=2&limit=100`)
      .then((backimage) => {
        return backimage.json();
      })
      .then(showbackimage);
  }

  useEffect(()=>{
    backgroundImage();
  },[]);

  function showbackimage(backimage) {
    console.log(backimage);
  }
  return(
    <>
        <img src={backimage[0].downlod_url} alt='myPic' className='card_img' />
    </>
  )

}

export default Background
